import React from 'react';

const PostIdItem = ( props) => {
    return (
        <div className='post'>
            <h2>Post {props.post.id}</h2>
            <div className="post__content">
                <strong>{props.post.title}</strong>
                <div>
                    {props.post.body}
                </div>
            </div>
        </div>

    );
};

export default PostIdItem;
